Using the C++ API (Experimental)Turi Create provides a C++ API to enable embedding into other applications or services, as a way to deploy models for inference, or to enable training in embedded scenarios where there is no Python interpreter. This consists of a set of headers; when those headers are consumed, the resulting library or application can be linked against the libunity provided by the turicreate package.The API documentation for the C++ API provides a more complete reference of available functions, classes, and methods. Note that this API is not stable and may change at any time; plan to pin a particular version of Turi Create to your application or service to make use of this API.CaveatsThis technique is experimental and depends on internal APIs within Turi Create that may change over time. The C++ API is not API-stable.

In order to link properly, some build flags must be shared between Turi Create and your project.

Not all functionality in the Turi Create Python package is available in the C++ API.

SetupUsing the C++ API requires building Turi Create from source, starting with a clone of the repository. You should consider checking out a particular release in order to keep API stability as you proceed (the API may change in master). Before proceeding to use the C++ API, run ./configure to set up the build system for the project, and run make -j8 from within release/src/unity to build the library artifacts that your application will depend on.Currently, the C++ API is not packaged for easy consumption outside of the Turi Create Python package. As a result, some care is needed when compiling and linking against Turi Create. This may cause compatibility issues since those compilation and linking flags may not be compatible with flags used elsewhere. Required compilation flags for your project include:-std=c++11 - some headers exposed by Turi Create require the use of C++11 or later.

-stdlib=libc++ - may be needed on macOS (probably not on Linux).

